    ivec2 p_C = convert_position_i(gl_FragCoord.xy, s_c, s_C, d_C);

    int m = p_C.x;
    int n = p_C.y;

    float v = 0.0;

    for (int k = 0; k < 96; k++) {
        vec4 v_a = texture2D(A, fract((vec2(k, m) + 0.5) / d_a));
        vec4 v_b = texture2D(B, fract((vec2(k, n) + 0.5) / d_b));

        v += dot(v_a, v_b);
    }

    gl_FragColor = vec4(v, 0, 0, 0);
}

